import React, {Component} from 'react';
import Todo from "../Todo/Todo";
import './LIst.css'
class List extends Component {
    render() {
        const {todos}=this.props
        return (
            <ul className="todo-main">
                {
                    todos.map((todo)=>{
                        return <Todo key={todo.id} {...todo}/>
                    })
                }
            </ul>
        );
    }
}

export default List;
